import './ListViewer.css'

import { MdPerson, MdChatBubble } from 'react-icons/md';

function ListViewer() {
    return (
        <div id="listViewer">
            <div id="listWrap">

            </div>
            <div id="listSelectWrap">

                <MdPerson className='listSelectBtn' />

                <MdChatBubble className='listSelectBtn' />

            </div>
        </div>
    )
}

export default ListViewer;
